import React, {Component} from 'react';
import {Media} from 'reactstrap';

class Menu extends Component{

    constructor(props){
        super(props);

        this.state = {
            dishes : [
                {
                    id : 0,
                    name : 'Uthappizza',
                    image : '../../public/assets/images/Uthappizza.png',
                    category : 'mains',
                    label : 'Hot',
                    price : '4.99',
                    description : 'A unique combination of indian food and italian food'
                },
                {
                    id : 1,
                    name : 'Zucchipakoda',
                    image : '../../public/assets/images/zucchipakoda.png',
                    category : 'appetizer',
                    label : '',
                    price : '1.99',
                    description : 'Deep fried zucinni coated with ....'
                },
                {
                    id : 2,
                    name : 'Elaicheese cake',
                    image : '../../public/assets/images/elaicheesecake.png',
                    category : 'dessert',
                    label : 'Hot',
                    price : '2.99',
                    description : 'A Deletable semi sweet......'

                }
            ]
        };
    }

    render(){
        const menu = this.state.dishes.map( (dish) => {
            return(
                <div key={dish.id} className="col-12 mt-5">
                    <Media tag="li">
                        <Media left middle>
                            <Media object src={dish.image} alt="err"></Media>
                        </Media>
                        <Media body className="ml-5">
                            <Media heading>{dish.name}</Media>
                            <p>{dish.description}</p>
                        </Media>
                    </Media>
                </div>
            );
        });

        return(
            <div className="container">
                <div className="row">
                    <Media list>
                        {menu}
                    </Media>

                </div>
            </div>
        );
    }
}

export default Menu;
